import React, {useEffect, useState} from 'react';
import axios from 'axios';
import {getStorageItem} from 'utils/sessionstorage';

const WorryDetail = ({match}) => {
    const [resData, setResData] = useState();
    const AUTH_TOKEN = 'Token ' + getStorageItem('jwtToken');

    useEffect(() => {
        getData();
        return () => {
        };
      }, []);

    
    const getData = async (e) => {
        try {
            axios.defaults.headers.common['Authorization'] = AUTH_TOKEN;   
            const response = await (await axios.get('/sitterJobs/findSitter/' + match.params.id));
           // console.log('response 확인 ', JSON.stringify(response));
            const {
                data: resData,
            } = response;
            setResData(resData);
        } catch (e) {
            if (e.response) {
                const { data } = e.response;
                console.error(data);
            }
        }
        
    };


    return (
        <div></div>
    );

}

export default WorryDetail;
